import React from "react";

const Player = () => {
  return (
    <React.Fragment className="player">
      <div className="time-control">
        <p1>kene</p1>
        <input type="range" />
        <p>End Time</p>
      </div>
      <div className="play-control"></div>
    </React.Fragment>
  );
};
export default Player;
